column8:
テレビ「NHKニュースおはよう日本まちかど情報室」で紹介された自分の部屋にプライベート空間を作れるテント！ネットカフェがうちにやってきた!話題の一人用室内テント。ポンッと飛び出す個人部屋。専用ロック、配線すっきりケーブルホール付。<CENTER><TABLE width='600'><TBODY><TR><TD><FONT size='2'>■BIBI LAB　ぼっちてんと　BT1-11</FONT></TD></TR><TR><TD><IMG src='https://image.rakuten.co.jp/waganseshop/cabinet/32/fe143-01.jpg' border='0'><BR><IMG src='https://image.rakuten.co.jp/waganseshop/cabinet/32/fe143-02.jpg' border='0'><BR><IMG src='https://image.rakuten.co.jp/waganseshop/cabinet/32/fe143-03.jpg' border='0'><BR><IMG src='https://image.rakuten.co.jp/waganseshop/cabinet/32/fe143-04.jpg' border='0'><BR><IMG src='https://image.rakuten.co.jp/waganseshop/cabinet/32/fe143-05.jpg' border='0'></TD></TR><TR><TD><FONT size='2' color='#ff0000'><B>注意） テント下部の縫製について</B></FONT><BR><FONT size='2'>テント下の各面中央付近には製造工程上の理由で意図的にフレームと生地を縫製していない箇所がございます。 縫製漏れではございませんので、予めご了承ください。</FONT></TD></TR></TBODY></TABLE></CENTER><BR><div align='center'><IMG src='https://image.rakuten.co.jp/dietshop/cabinet/campaign/kobetusouryou.gif' alt='個別送料商品につきまして'></div><BR><BR><TABLE width='300' border='0' cellpadding='5' cellspacing='1' bgcolor='#666666'><TBODY><TR><TD width='80' bgcolor='#FFFFCC'><FONT size='2'>【サイズ】</FONT></TD><TD bgcolor='#FFFFFF'><FONT size='2'>W130×H160×D130ｃm<BR>折畳み時：直径63×厚み5ｃm</FONT></TD></TR><TR><TD bgcolor='#FFFFCC'><FONT size='2'>【重量】</FONT></TD><TD bgcolor='#FFFFFF'><FONT size='2'>2.2kg</FONT></TD></TR><TR><TD bgcolor='#FFFFCC'><FONT size='2'>【素材】</FONT></TD><TD bgcolor='#FFFFFF'><FONT size='2'>ポリエステル、スチール</FONT></TD></TR><TR><TD bgcolor='#FFFFCC'><FONT size='2'>【推奨デスク幅】</FONT></TD><TD bgcolor='#FFFFFF'><FONT size='2'>～120ｃm</FONT></TD></TR><TR><TD bgcolor='#FFFFCC'><FONT size='2'>【JAN】</FONT></TD><TD bgcolor='#FFFFFF'><FONT size='2'>4582474896922</FONT></TD></TR></TBODY></TABLE><br>広告文責：株式会社ノースウェブ　Tel 0144-52-0018<br><div id="migi-obi">

